Quote from ALLCDcovers

&quot;Adding pop savvy to their soul-disco mix, Jamiroquai grabbed the attention of MTV and Top 40 radio and won a Grammy with this platinum-selling album, Travelling Without Moving. It's a fine record, with warm keyboards, sweet strings, and irrepressible grooves grounding Jay Kay's sublime vocals and fuelling the hits &quot;Virtual Insanity&quot;, &quot;Cosmic Girl&quot; and the title track. That voice--elastic, jazzy--is the fire of the band, but immaculate guitar sounds, snappy backup vocals and clever old-school soul samples (Eddie Harris on &quot;Alright&quot;, Esther Phillips on &quot;High Times&quot;) are the details that create perfection&quot;

To my liking the best album of Jamiroquai!

